import React from 'react';

const LoginNavigation = ({onRoutChange, isSignedIn}) => {
		if (isSignedIn){
		return (
		<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
		  <p onClick={() => onRoutChange('signout')} className='f5 link dib black underline pa3 pointer' > SignOut </p>
		 </nav>
		 );
		} else {
		return (
			<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
		  <p onClick={() => onRoutChange('signin')} className='f5 link dib black underline pa3 pointer' > Sign in </p>
		  <p onClick={() => onRoutChange('register')} className='f5 link dib black underline pa3 pointer' > Register </p>
		 </nav>
        );
	}
}
export default LoginNavigation;
